import React from 'react'
import { Link } from 'react-router-dom';
import './LogIn.css';

function LogIn() {
    return (
        <div className="page">
        <div>
            <Link to="/login">
            <button>Log In</button>
            </Link>
            <Link to="/signup">
            <button>Sign Up</button>
            </Link>
            <Link to="favorite">
            <button>Favorite</button>
            </Link>
        </div>

        <div></div>
        </div>    
    );
}

export default LogIn
